records_token = ""

corrections_map = ""

def base64_gzipped_yaml_to_hash(base64_string)
    # 1. Decode the Base64 string
    compressed_data = Base64.decode64(base64_string)
  
    # 2. Gunzip (inflate) the data
    yaml_str = Zlib::Inflate.inflate(compressed_data)
  
    # 3. Load the YAML into a Ruby object (Hash)
    YAML.load(yaml_str)
  end


id_token = base64_gzipped_yaml_to_hash(records_token)
substitutions = base64_gzipped_yaml_to_hash(corrections_map)

id_token.each do |id, token|
    save = false
    corrected = []
    s = Source.find(id)

    s.marc.each_by_tag("588") do |t|
        t.fetch_all_by_tag("a").each do |tt|
            next if !tt || !tt.content
            if tt.content.include?(token)
                subst = substitutions[token]
                if !subst
                    puts "#{s.id}\tSKIP\t#{token}"
                else
                    corrected << token
                    save = true
                    tt.content = tt.content.gsub(token, substitutions[token])
                    #puts "saved #{s.id}"
                end
                
            end
        end
    end

    s.paper_trail_event = "Correct 588 #{corrected.join(", ")}"
    s.save if save

end